import { useParams } from "react-router-dom";
import FileUpload from "../FileUpload.js";
import Chatbot from "../Chatbot.js";

const Chat = () => {
    const { professorId } = useParams();

    return (
        <div>
            <h1>Chat with {professorId}</h1>
            <Chatbot></Chatbot>
        </div>
    );
};

export default Chat;
